  - name: AMENDED CD
    number: '5'
    value: '    The transfers shown reflect variations due to timing of transfers
      based upon reimbursements from the non-federal and Levin accounts the federal
      account at different points in the 70-day window provided in Reg. 10-6.7(f)(2).  No
      transfers were made outside the 70-day window.      Our filing software would
      not allow us to detail information pertaining to receipts on Line 15 of our
      report. The reimbursement from Masy Bunnell was for personal charges which were
      inadvertently charged on the committees credit card. The checks from USPS refer
      to returned postage from direct mail pieces which were previously paid with
      100% federal dollars. The SCE refund deals with a return of a deposit. The Adp  refund
      deals with a payroll tax refund'
  - value: ' which was previously paid with 100% federal dollars.      In regard to
      occupation and employer information requested'
  - value: ' a letter is sent to those donors whose contributions exceed $200'
  - value: ' but did not provide us with their employer and occupation on our initial
