  input: "\"TEXT\",\"F3XN\",\"C00140590\",\"May  18 2007\t\t    Laura S.  Federal
    Elections Commission    RE:  California Republican Party           FEC ID#  C00140590
    \          May  Monthly Report (04//07-04/30/07)              Dear Laura S,    The
    transfers shown reflect variations due to timing of transfers based upon reimbursements
    from the non-federal and Levin accounts the federal account at different points
    in the 70-day window provided in Reg. 10-6.7(f)(2).  No transfers were made outside
    the 70-day window.      Our filing software would not allow us to detail information
    pertaining to receipts on Line 15 of our report. The reimbursement from Masy Bunnell
    was for personal charges which were inadvertently charged on the committees credit
    card. The checks from USPS refer to returned postage from direct mail pieces which
    were previously paid with 100% federal dollars. The SCE refund deals with a return
    of a deposit. The Adp  refund deals with a payroll tax refund, which was previously
    paid with 100% federal dollars.      In regard to occupation and employer information
    requested, a letter is sent to those donors whose contributions exceed $200, but
    did not provide us with their employer and occupation on our initial contribution
    solicitation which sites the FEC regulation for the requested information.  The
    committees policy is to send a follow-up letter within thirty days of the original
    contribution to request this information with a pre-addressed envelop enclosed
    for the return of such information.  All such information received is reported
    accordingly.  If information is received after the reporting deadline, the committee
    will amend the appropriate monthly report.        Fred Arjani\""
